import React, { Fragment } from "react"

const Navbar = styled.div`
  padding: 1em;
  transition: .5s;
`
export const Navlink = styled(NavLink)`
  color:#69302c;
  font-size: 19px;
`
// const NavBrand = styled.div`
//   color:#69302c;
// `

const Button = styled.button`
  cursor: pointer;
  font-weight: 500;
  background-color: transparent;
  color: #69302c;
  border: 2px solid #69302c;
  border-radius: .1em;
  padding: .5em 1.25em;
  font-size: 19px;
  &:hover{
    background-color: #69302c;
    color: #fff;
  }
`

const Logo = styled.img`
  height: 60px;
`
export default class NavBar extends React.Component {
    render() {
        return (
            <Navbar expand='md' className='sticky-top' light>
                <Container>
                    <a href="#" class="navbar-brand">
                        <Logo class="logo" src="/static/img/Asset_10.svg" />
                    </a>
                    <NavbarToggler onClick={this.toggle} />
                    <Collapse isOpen={this.state.isOpen} navbar>
                        {children || <Fragment>
                            <Nav className='mr-auto ml-auto' navbar>
                                <NavItem>
                                    <Link className='px-3' to='what' smooth >
                                        คืออะไร
                  </Link>
                                </NavItem>
                                <NavItem>
                                    <Link className='px-3' to='who' smooth >
                                        ใครมาพูด
                  </Link>
                                </NavItem>
                                <NavItem>
                                    <Link className='px-3' to='where' smooth>
                                        จัดที่ไหน
                  </Link>
                                </NavItem>
                            </Nav>
                            <Navlink>
                                <Button onClick={this.changeRoute} className='fixed-right'>ส่งหัวข้อสุดชิพ</Button>
                            </Navlink>
                        </Fragment>
                        }
                    </Collapse>
                </Container>
            </Navbar>
        )
    }
}
